import React from 'react';
import './HomePage.css';
import NavigationContainer from './NavigationMenu.js';
import Kurt from "./asset/MaskGroup.png";
import Liam from "./asset/liam.png";
import Alex from "./asset/alex.png";
import Nuno from "./asset/nuno.png";

const Menu = () => {

    return(

        <NavigationContainer />


    );

};


const Isi = () => {

    return(
        <div className="ContainerLuar2">
    <div className="ContainerDua">

        <div className="Header">Jadwal Pasien</div>

        <div className="Header2Container">
            <div className="buttonKiri">+ New appointment</div>
            <div className="buttonKanan">Today v</div>
        </div>


        <div className="CardContainer1">
            <Card 
                image={Kurt}
                nama="Nandhika"
                perawatan="Kontrol Gigi"
                jam="12:00"
            ></Card>

            <Card 
                image={Liam}
                nama="Pratama"
                perawatan="Kontrol Behel"
                jam="13:00"
            ></Card>


            <Card 
                image={Alex}
                nama="Putra"
                perawatan="Ganti Karet"
                jam="14:00"
            ></Card>


            <Card 
                image={Nuno}
                nama="Nesia"
                perawatan="Tambel gigi"
                jam="15:00"
            ></Card>

        </div>

        <div className="CardContainer1">
            <Card 
                image={Kurt}
                nama="Nandhika"
                perawatan="Kontrol Gigi"
                jam="12:00"
            ></Card>

            <Card 
                image={Liam}
                nama="Pratama"
                perawatan="Kontrol Behel"
                jam="13:00"
            ></Card>


            <Card 
                image={Alex}
                nama="Putra"
                perawatan="Ganti Karet"
                jam="14:00"
            ></Card>


            <Card 
                image={Nuno}
                nama="Nesia"
                perawatan="Tambel gigi"
                jam="15:00"
            ></Card>

        </div>

    </div>
    </div>

    );




};


const Card = props => {
    const { nama, perawatan, jam, image} = props;
    return(
        <div className="CardContainer">
            <div className="DeleteContainer">
            <div className="Delete">delete</div>
            </div>
            <div className="FotodanNama">
                <img className="Foto2" src = {image} />

                <div className="Nama">
                    <div className="Atas">{nama}</div>
                    <div className="Bawah">{perawatan}</div>
                </div>
            </div>

            <div className="CheckOrCancelContainer">
                <div className="JamJadwal">{jam}</div>

                <div className="CnC">
                    <div className="btnCheck">Finish</div>
                    <div className="btnCancel">Cancel</div>
                </div>
            </div>

            <div className="DetailsContainer">
                <div className="btnDetails">View details</div>
            </div>


        </div>


    );



};



const HomeContainer = () => {

    return(
       <div className="ContainerUtama">
        <Menu />
        <Isi />
        </div>


    );



};

export default HomeContainer;
